import API from "../utils/api";
import React, {useState } from "react";

const HomePage= ()=>{
    const [myState,setState]=useState({
        name:"",
        gender:"",
        nat:""
    });
    console.log(API.randoUser());
    API.seed()
    .then(res=>setState({
        name:res.name[0][0],
        gender:res.gender[0]
    }))
}
export default HomePage;
